The count function will return the number of occurrences of the word in the file.
#include <iostream>
#include <fstream>
#include <string>
using namespace std;

int count(string word, string file) {

    string line;
    int count = 0;
    while (getline(file, line)) {
        if (line.find(word)!= string::npos) {
            count++;
        }
    }
    return count;
}

int main() {
    string file = "input.txt";
    cout << count("a","input.txt") << endl;
    return 0;
}
